isometry.IsometryTranspileBench.time_sim.code:
class IsometryTranspileBench:
    def time_simulator_transpile(self, *unused):
        transpile(self.circuit, basis_gates=['u1', 'u3', 'u2', 'cx'],
                  seed_transpiler=0)

    def setup(self, m, n):
        q = QuantumRegister(n)
        qc = QuantumCircuit(q)
        if not hasattr(qc, 'iso'):
            raise NotImplementedError
        iso = random_unitary(2 ** n, seed=0).data[:, 0:2 ** m]
        if len(iso.shape) == 1:
            iso = iso.reshape((len(iso), 1))
        qc.iso(iso, q[:m], q[m:])
        self.circuit = qc

passes.Collect2QPassBenchmarks.track_con.code:
class Collect2QPassBenchmarks:
    def track_consolidate_blocks_depth(self, _, __):
        _pass = ConsolidateBlocks()
        _pass.property_set['block_list'] = self.block_list
        return _pass.run(self.dag).depth()

    def setup(self, n_qubits, depth):
        seed = 42
        self.circuit = random_circuit(n_qubits, depth, measure=True,
                                      conditional=True, reset=True, seed=seed)
        self.dag = circuit_to_dag(self.circuit)
        collect_blocks = Collect2qBlocks()
        collect_blocks.run(self.dag)
        self.block_list = collect_blocks.property_set['block_list']

